import React from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const Home = () => {
  const navigate = useNavigate();
  const { user } = useAuth();

  return (
    <div>
      <h1>Welcome to LFG Finder</h1>
      {user ? (
        <p>Here are your active posts:</p>
      ) : (
        // Add logic to display active posts or other user-specific content
        <p>Please log in to see your posts.</p>
      )}
    </div>
  );
};

export default Home;
